import './App.css';
import Top from './Components/Top-Section';
import Middle from './Components/Middle-Section';
import Third from './Components/Third-Section';
import Founder from './Components/Founder-Section';

function App() {
  return (
    <div className="App">
        <Top />
        <Middle />
        <Third />
        <Founder />
    </div>
  );
}

export default App;
